// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Persssist {
    string public name = "Persssist";
    uint256 public fileCount = 0;
    
    // this mapping behaves as a "catalog"
    // of files uploaded to the storage, we declare
    // it as public in order to access it directly from the Frontend
    mapping(uint256 => File) public files;
    mapping(uint256 => uint256) public sizeOfFiles;

    struct Name {
        string Nombre;
        string Apellido1;
        string Apellido2;
    }
    
    Name owner_name = Name(
        "Sergio",
        "Munoz",
        "Garrido"
    );

    function getOwnerName () public view returns (string memory Nombre, string memory Apellido1, string memory Apellido2){
        return (owner_name.Nombre, owner_name.Apellido1, owner_name.Apellido2);
    }

    function getNamePrueba () public view returns (string memory){
        return owner_name.Nombre;
    }

    struct File {
        uint256 fileId;
        string filePath;
        uint256 fileSize;
        string fileType;
        string fileName;
        address payable uploader;
    }

    event FileUploaded(
        uint256 fileId,
        string filePath,
        uint256 fileSize,
        string fileType,
        string fileName,
        address payable uploader
    );
    
    // we upload the file metadata
    // to the smart contract files
    // mapping in order to persist
    // the information.
    function uploadFile(
        string memory _filePath,
        uint256 _fileSize,
        string memory _fileType,
        string memory _fileName
    ) public {
        require(bytes(_filePath).length > 0);
        require(bytes(_fileType).length > 0);
        require(bytes(_fileName).length > 0);
        require(msg.sender != address(0));
        require(_fileSize > 0);
        
        // since solidity mappings
        // do not have a lenght attribute
        // the simplest way to control the amount 
        // of files is using a counter
        fileCount++;

        files[fileCount] = File(
            fileCount,
            _filePath,
            _fileSize,
            _fileType,
            _fileName,
            payable(msg.sender)
        );

        sizeOfFiles[fileCount] = _fileSize;
        
        // From the frontend application
        // we can listen the events emitted from
        // the smart contract in order to update the UI.
        emit FileUploaded(
            fileCount,
            _filePath,
            _fileSize,
            _fileType,
            _fileName,
            payable(msg.sender)
        );
    }

    function getFiles () public view returns (File[] memory, uint256[] memory) {
        //Para dar valores a los arrays _files y _sizeOfFiles es necesario inicializarlos primero.
        //Es necesario inicializarlos para que tengan un tamaño fijo, como se muestra a continuación:
        File[] memory _files = new File[](fileCount);
        uint256[] memory _sizeOfFiles = new uint256[](fileCount);

        for (uint256 i = 0; i < fileCount; i++) {
            _files[i] = files[i+1];
            _sizeOfFiles[i] = sizeOfFiles[i+1];
        }

        return (_files, _sizeOfFiles);
    }

}
